description:
The Party {New 2014} XXX_Split Scenes

Starring: 

Samantha Saint, Kendra Lust, Brandi Love, Toni Ribas, Steven St. Croix, Danny Mountain, Van Wylde

Description: 

What could go wrong? It's New Year's Day and our cast of characters (a businessman, his younger wife and two ex-wives) are nursing hangovers and trying to piece together what happened the night before. Through a series of flashbacks, we learn that partying and hyperactive libidos were responsible for shredded business documents, a facial tattoo and wild, no-holds barred sex! Funny, Irreverent and Hot as Hell ... RSVP today for The Party!

